package com.belk.api.model.productdetails;

/**
 * Pojo for SKU Main.
 * 
 * @author Mindtree
 * @date Jul 24, 2013
 */
public class SKUMain {
	/**
	 * SKUMain key.
	 */
	private String key;
	/**
	 * SKUMain value.
	 */
	private String value;

	/**
	 * Default constructor.
	 */
	public SKUMain() {
		// TODO Auto-generated constructor stub
	}

	/**
	 * @return the key
	 */
	public final String getKey() {
		return this.key;
	}

	/**
	 * @param key
	 *            the key to set
	 */
	public final void setKey(final String key) {
		this.key = key;
	}

	/**
	 * @return the value
	 */
	public final String getValue() {
		return this.value;
	}

	/**
	 * @param value
	 *            the value to set
	 */
	public final void setValue(final String value) {
		this.value = value;
	}

}
